    <child ID="1476"
        label="deleting all triple &#xa;      statements that have the to-be-deleted component as 'subject' or 'object' and then deleting all unconnected components"
        layerID="1" created="1421712776665" x="3963.7412" y="304.16403"
        width="588.0" height="300.0" strokeWidth="0.0" autoSized="false" xsi:type="text">
        <strokeColor>#404040</strokeColor>
        <textColor>#000000</textColor>
        <font>-plain-36</font>
        <URIString>http://vue.tufts.edu/rdf/resource/04c86d34c0a8b23501b0b65cc69a73e6</URIString>
        <richText>&lt;html&gt;
  &lt;head color="#ffffff" style="color: #ffffff"&gt;
    &lt;style type="text/css"&gt;
      &lt;!--
        body { font-family: Arial; margin-top: 0px; font-size: 12; margin-bottom: 0px; margin-left: 0px; color: #ffffff; margin-right: 0px }
        ol { font-family: Arial; margin-top: 6; font-size: 12; vertical-align: middle; list-style-position: outside; margin-left: 30 }
        p { margin-top: 0; margin-bottom: 0; margin-left: 0; color: #ffffff; margin-right: 0 }
        ul { font-family: Arial; margin-top: 6; font-size: 12; vertical-align: middle; list-style-position: outside; margin-left: 30 }
      --&gt;
    &lt;/style&gt;
    
  &lt;/head&gt;
  &lt;body&gt;
    &lt;p color="#ffffff" style="text-align: right; color: #ffffff"&gt;
      &lt;font color="#000000" style="font-size:36;"&gt;&lt;b&gt;deleting all triple 
      statements that have the to-be-deleted component as 'subject' or 
      'object' &lt;/b&gt;&lt;/font&gt;
