    <child ID="2503"
        label="mdbuiap:'set new focus on&#xa;MDB entry ID (individual of)'"
        layerID="1" created="1480688219536" x="2607.9167" y="326.17163"
        width="347.99097" height="59.28882" strokeWidth="1.0"
        autoSized="false" controlCount="1" arrowState="2" xsi:type="link">
        <notes>This annotation specifies a class of MDB entry ID that defines the focus for the ongoing action. Based on the specified class and the point from which the respective action has been triggered, the middleware is able to identify the individual MDB entry ID that defines the entry in focus. Based on this focus, the middleware is able to resolve all references to classes that are intended to be references to individual resources to the respective individual resources.%nl;%nl;This specified focus holds in all subsequent execution steps of this action, until another 'set new focus on MDB entry ID' annotation changes the focus again.%nl;%nl;If used within an execution step, this annotation is executed first before any other annotations of this execution step can be executed.</notes>
        <strokeColor>#404040</strokeColor>
        <textColor>#5C8DAC</textColor>
        <font>Arial-bold-12</font>
        <URIString>http://vue.tufts.edu/rdf/resource/bfeb4a4cc0a8b22400bcd5609ec0a565</URIString>
        <point1 x="2608.4167" y="384.96045"/>
        <point2 x="2955.4077" y="331.80176"/>
        <ID1 xsi:type="node">1318</ID1>
        <ID2 xsi:type="node">2504</ID2>
        <ctrlPoint0 x="2730.9214" y="323.96213" xsi:type="point"/>
    </child>
    <child ID="2504" label="mdbentry:MDB entry ID" layerID="1"
        created="1480688219536" x="2955.4077" y="312.64792"
        width="163.0" height="44.0" strokeWidth="1.0" autoSized="true" xsi:type="node">
        <notes>The MDB entry ID consists of the MDB core ID and a version ID. It is a resolvable unique URL that is composed of:%nl;%nl;'www.morphdbase.de/resource/UEID-DATE-TYPE-SERIALNo-VersionID'%nl;%nl;UEID: This is the unique user entry ID and consists of a string of 8 hexadecimal character values. No two MDB user entries have the same UEID.%nl;DATE: creation date of the entry.%nl;TYPE: A single character specifying the type of entry (S=Specimen, T=Taxon, M=Media, L=Literature, Mx=Matrix, MD=Morphological Description, TD=Taxonomic Description).%nl;SERIALNo: A serial number that counts all core entries that the user has created so far (the first starting with "1" and continuing in integers).%nl;%nl;Version_ID: The Version ID of the particular Entry, with the first published version having the ID "P_1" and each following published revision version counting up in integers. Draft versions are distinguished from published version by a "D" (and revision draft version by a "R") instead of the "P" and additionally identified by a separate number that follows the version number. For each new draft version this number is counted up in integers (first draft would be "D_1_1" and the next draft version would be "D_1_2"; when this entry is published, its VersionID would be %sp;"P_1" and its first revision draft version "R_2_1").</notes>
        <fillColor>#F2AE45</fillColor>
        <strokeColor>#776D6D</strokeColor>
        <textColor>#000000</textColor>
        <font>Arial-plain-12</font>
